import React from 'react';
import { Link } from 'react-router-dom';
import './Navigation.css';

const barStyle = {
    position: 'absolute',
    width: '800px',
    color: 'white',
    backgroundColor: '#333', // Added background for better visibility
    padding: '10px',
    borderRadius: '5px'
};

const linkStyle = {
    color: 'white',
    textDecoration: 'none',
    padding: '10px',
    display: 'inline-block',
};

const Navigation = () => {
    return (
        <div>
            <ul className="bar" style={barStyle}>
                <li className="names">
                    <Link to="/" style={linkStyle}>HOME</Link>
                </li>
                <li className="names">
                    <Link to="/messages" style={linkStyle}>MESSAGES</Link>
                </li>
                <li className="names">
                    <Link to="/departments" style={linkStyle}>DEPARTMENTS</Link>
                </li>
                <li className="names">
                    <Link to="/students" style={linkStyle}>STUDENTS</Link>
                </li>
                <li className="names">
                    <Link to="/sections" style={linkStyle}>SECTIONS</Link>
                </li>
            </ul>
        </div>
    );
};
